import React from 'react';
import TodoListItems from './todo-list-items';

const TodoList = ( {todo} ) => {

    const element = todo.map((item) => {
        return(
            <li> <TodoListI label = {item.label} important = {item.important} /> </li>
        )
    });

    return (
        <ul>
            { element }
        </ul>
    )
}

export default TodoList;
